{"query":"query providerPeople($npis: [Float!]!){
  providerIndividual(input:{
    npis: $npis
  }){
    npi
    name_last
    name_first
    name_middle
    credentials
    gender
  }
}
","variables":{"npis":[1003082041]}}

{"query":"query performance(
  $npi: Float
  $hcpcs_code: String = null
  $order: [String!] = null,
  $limit: Float=4
  $page: Float=2
){
  countProviderPerformances(
    input:{
      npi: $npi
      hcpcs_code: $hcpcs_code
    }
  ){
    count
  }

  providerPerformances(
    input:{
      npi: $npi
      hcpcs_code: $hcpcs_code
    },
    pagination: {
      limit: $limit,
      page: $page,
      order: $order
    }
  ){
    npi
    mcare_participation_indicator
    place_of_service
    hcpcs_code
    n_of_svcs
    n_of_mcare_beneficiaries
    n_of_distinct_mcare_beneficiary_per_day_svcs
    avg_mcare_allowed_amt
    avg_submitted_charge_amt
    avg_mcare_pay_amt
    avg_mcare_standardized_amt
    service{
      hcpcs_code
      hcpcs_description
      hcpcs_drug_indicator
    }
    provider{
      npi
      entity_type
      provider_type
    }
  }  


}
","variables":{"npi":1003010208,"hcpcs_code":"G0008","order":["n_of_svcs desc","avg_mcare_standardized_amt desc"],"page":1,"limit":4}}

{"query":"query suggest($search: String!, $limit: Int=8){
  suggestProviders(
